css:
@namespace url("http://www.w3.org/1999/xhtml");

/* to make it appear in the 'google.com' & 'www.google' sub-category of userstyles.org */
@-moz-document domain("google.com"), url-prefix("http://www.google") { }


@-moz-document url-prefix("http://maps.google") {

#header:after {
  display: block !important;
  content: "Please install 'Google Aero!' first for best results!" !important;
  font-size: 10px !important;
}
#page {
  position: fixed !important;
  top: 110px !important;
}
#mclip { display: none !important; }

#main_map #links {
  position: fixed !important;
  top: 83px !important;
  right: 0 !important;
}

#ds_h .ds, #ds_v .ds { top: 0 !important; }

.bar { background: transparent !important; }
.bar_divider { display: none !important; }

#panel {
  border-right: solid 1px #696969 !important;
  background: #F4F6FE !important;
}
#panel[style*="left: -380"] {
  border-right: solid 8px transparent !important;
  background: transparent !important;
}
#panel[style*="left: -380"]:hover {
  left: 0 !important;
  border-right: solid 1px #696969 !important;
  background: #F4F6FE !important;
}

#panel #paneltoggle2 img {
  width: 28px !important;
  left: -28px !important;
  top: -30px !important;
  cursor: default !important;
}
#panel[style*="left: -380"] #paneltoggle2 img {
  left: -20px !important;
  top: -27px !important;
}

#spsizer {
  -moz-box-sizing: border-box !important;
  margin: 0 6px !important;
  overflow: hidden !important;
  border-top: solid 4px #F4F6FE !important;
  border-bottom: solid 4px #F4F6FE !important;
}
div.opanel {
  -moz-box-sizing: border-box !important;
  height: 100% !important;
  margin: 0 !important;
  padding: 6px !important;
  overflow: auto !important;
  border: solid 1px #696969 !important;
  background: white !important;
}
#opanel3 {
  -moz-box-sizing: border-box !important;
  padding: 0 !important;
  overflow: hidden !important;
}
#mmheaderpane, div.mmbodypane {
  padding: 4px 6px 0 !important;
}

#panel .bar {
  padding-top: 30px !important;
  height: 0 !important;
  overflow: hidden !important;
}
#panel .leaf_links li {
  float: left !important;
  position: relative !important;
  top: -22px !important;
}
#panel .leaf_links a {
  padding: 6px 4px 5px 8px !important;
  margin: 0 4px 0 -4px !important; /* right margin = right image width  */
  font: menu !important;
  color: black !important;
  text-decoration: none !important;
  outline: none !important;
  cursor: default !important;
}
#panel .leaf_links a span {
  text-decoration: none !important;
}
#panel .leaf_links a:before {
  display: inline-block !important;
  margin: 1px 6px -4px -2px !important;
  vertical-align: top !important;
}
#panel .leaf_links a:after {
  content: "" !important;
  padding: 6px 4px 5px 0 !important; /* horiz. padding = image width */
  margin: 0 -8px 0 4px !important; /* right margin = text padding + image width; left margin = image width; */
}

/* IMAGES */
#panel .leaf_links a:hover                                              { background: left  no-repeat url("data:image/gif;base64,") !important; }
#panel .leaf_links a:hover:after                                        { background: right no-repeat url("data:image/gif;base64,") !important; }
#panel .leaf_links a:active,       #panel .leaf_links a.launchsel       { background: left  no-repeat url("data:image/gif;base64,") !important; }
#panel .leaf_links a:active:after, #panel .leaf_links a.launchsel:after { background: right no-repeat url("data:image/gif;base64,R0lGODlhBAAaAMQAAH5+gunq8ujp8efo8Lq7wGVmamRlaV9gZOnr8+jq8nR1eZaXm56fo9rc49TW3ebo7+Xn7uPl7OLk69/h6FVWWdPV28zO1GVmaefp76Cip5+hpre5vtfZ3qCiplVWWP///yH5BAEAAB8ALAAAAAAEABoAAAU9IFVoH7Mo2UZUh2VFlOPATQNPExzt1PPAAgFQSAnCJBIdDwKBMWGDASwQmFYpVKsWe0UkKgYMB9DxXDqfEAA7") !important; }

#panel #paneltoggle2 img        { background: no-repeat 4px 8px url("data:image/gif;base64,R0lGODlhEQAQAIAAAJaWlv///yH5BAEAAAEALAAAAAARABAAAAIcjI+py+2vgDwStBqwqxNq3z2ctU1fFJ7QyrZsAQA7") !important; }
#panel #paneltoggle2 img:hover  { background: no-repeat 4px 8px url("data:image/gif;base64,") !important; }
#panel #paneltoggle2 img:active { background: no-repeat 4px 8px url("data:image/gif;base64,") !important; }

#panel[style*="left: -380px"] #paneltoggle2 img { background: no-repeat 0 url("data:image/png;base64,") !important; }
/* END IMAGES */

}
